    public int numSubarrayProductLessThanK(int[] nums, int k) {
        int total = 0;
        int arrLength = nums.length;
        for (int length = 1; length <= arrLength; length++) {
            for (int i = 0; i < arrLength - length + 1; i++) {
                int sum = 1;
                int index = 0;
                for (int m = length - 1; m >= 0; m--) {
                    int ind = i + length - 1 - m;
                    sum = sum * nums[ind];
                    if (sum >= k) {
                        break;
                    }
                    index++;
                }
                if (index == length) {
                    total++;
                }
            }
        }
        // Write your code here
        return total;
    }

    public int numSubarrayProductLessThanK1(int[] nums, int k) {
        int total = 0;
        int arrLength = nums.length;
        for (int index = 0; index < arrLength; index ++) {
            for (int length = 1, tempLength = arrLength-index; length <= tempLength; length++) {
                int sum = 1;
                boolean flag = true;
                for (int m = 0; m < length; m++) {
                    int idx = index + m;
                    sum = sum * nums[idx];
                    if(sum >= k) {
                        flag=false;
                        break;
                    }
                }
                if(flag){
                    total++;
                } else {
                    break;
                }
            }
        }
        return total;
    }
